import React from "react";
import logo from "./asset/TestLogo.svg";

function Nav() {
  return (
    <div className="w-[1564px] h-[72px] m-[18px] rounded-[70px] bg-[#ffffff]">
      <div className="mt-[30px] pl-[50px] bg-[red]">
        <img
          className="h-[48px] w-[210.58px]"
          src={logo}
        ></img>
      </div>
      <div></div>
      <div></div>
    </div>
  );
}

export default Nav;
